export const nameRegexp = /^([a-zA-Z ]){3,20}$/;

export const lastNameRegexp = /^([a-zA-Z ]){3,20}$/;

export const emailRegexp =  /^[a-zA-Z0-9.!#$%&'*+/=?^_`{|}~-]+@[a-zA-Z0-9-]+(?:\.[a-zA-Z0-9-]+)*$/;

export const passwordRegexp = "^(?=.*[a-z])(?=.*[A-Z])(?=.*[0-9])(?=.*[!@#\$%\^&\*])(?=.{8,})";

export const numberRegexp = /^[1-9]\d*$/;
